import React from 'react';
import { Link } from 'react-router-dom';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';

function AdminDashboard() {
  return (
    <Box sx={{ textAlign: 'center', py: 4 }}>
      <Typography variant="h4" color="primary" gutterBottom>Admin Dashboard</Typography>
      <Box sx={{ display: 'flex', justifyContent: 'center', gap: 3, mt: 2 }}>
        <Button variant="contained" color="primary" component={Link} to="/products">View Products</Button>
        <Button variant="contained" color="primary" component={Link} to="/add-product">Add Product</Button>
        <Button variant="contained" color="primary" component={Link} to="/orders">View Orders</Button>
      </Box>
    </Box>
  );
}

export default AdminDashboard;
